// src/components/Slider.js
import React from 'react';
import './Slider.css';

const Slider = () => {
  return (
    <div className="slider">
      <div className="slide">
        <img src="/images/img.jpg" alt="Flash Sale 1" />
      </div>
      <div className="slide">
        <img src="/flash-sale2.jpg" alt="Flash Sale 2" />
      </div>
      {/* Add more slides as needed */}
    </div>
  );
};

export default Slider;
